import React from "react";
import Slider from "react-slick";

const RaportowanieCarousel = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 700,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
  };

  return (
    <Slider {...settings}>
      <div className="slide">
        <img src="../images/rap1.png" alt="" />
      </div>
      <div className="slide"></div>
      <div className="slide"></div>
    </Slider>
  );
};

export default RaportowanieCarousel;
